import React, { useState } from "react";
import {
  Home,
  Search,
  FileText,
  Globe,
  Users,
  Settings,
  HelpCircle,
  Bell,
  MessageCircle,
  User,
  PlusCircle,
  Menu,
  FileCheck,
} from "lucide-react";

const Navigation = () => {

  const [isUserMenuOpen, setIsUserMenuOpen] = useState(false);

  const sideNavItems = [
    { icon: Home, label: "Home", path: "/" },
    { icon: Search, label: "Course Search", path: "/courses" },
    { icon: FileText, label: "My Applications", path: "/applications" },
    { icon: FileCheck, label: "Visa Status", path: "/visa" },
    { icon: Globe, label: "Country Guide", path: "/countries" },
    { icon: Users, label: "Community", path: "/community" },
    { icon: Settings, label: "Settings", path: "/settings" },
    { icon: HelpCircle, label: "Help Center", path: "/help" },
  ];

  return (
    <div className="min-h-screen">
      {/* Top Navigation */}
      <div className="fixed top-0 right-0 left-0 h-16 bg-white shadow-sm z-50 px-4 flex items-center justify-between">
        {/* Left Section */}
        <div className="flex items-center gap-4">
          <button
            onClick={() => setIsExpanded(!isExpanded)}
            className="p-2 hover:bg-gray-100 rounded-lg transition-colors"
          >
            <Menu size={24} />
          </button>
          <div className="flex items-center gap-2">
            <span className="text-green-600 font-bold text-xl">Adventus.io</span>
          </div>
        </div>

        {/* Right Section */}
        <div className="flex items-center gap-4">
          <button className="bg-green-50 text-green-600 px-4 py-2 rounded-lg hover:bg-green-100 flex items-center gap-2 transition-colors">
            <PlusCircle size={24} />
            <span>Add Application</span>
          </button>

          {/* Notifications */}
          <button className="p-2 hover:bg-gray-100 rounded-lg relative">
            <Bell size={24} />
            <span className="absolute top-1 right-1 bg-red-500 text-white text-xs rounded-full w-4 h-4 flex items-center justify-center">
              3
            </span>
          </button>

          {/* Messages */}
          <button className="p-2 hover:bg-gray-100 rounded-lg relative">
            <MessageCircle size={24} />
            <span className="absolute top-1 right-1 bg-blue-500 text-white text-xs rounded-full w-4 h-4 flex items-center justify-center">
              2
            </span>
          </button>

          {/* User Profile */}
          <div className="relative">
            <button
              onClick={() => setIsUserMenuOpen(!isUserMenuOpen)}
              className="flex items-center gap-2 p-2 hover:bg-gray-100 rounded-lg"
            >
              <div className="bg-purple-100 text-purple-600 w-8 h-8 rounded-full flex items-center justify-center">
                <span className="text-sm font-medium">RP</span>
              </div>
              <span className="text-sm font-medium">Richard Pokhrel</span>
            </button>

            {/* User Dropdown Menu */}
            {isUserMenuOpen && (
              <div className="absolute right-0 mt-2 w-48 bg-white rounded-lg shadow-lg py-2 border">
                <a
                  href="/profile"
                  className="flex items-center gap-2 px-4 py-2 hover:bg-gray-100"
                >
                  <User size={20} />
                  <span>Profile</span>
                </a>
                <a
                  href="/logout"
                  className="flex items-center gap-2 px-4 py-2 hover:bg-gray-100 text-red-600"
                >
                  <User size={20} />
                  <span>Logout</span>
                </a>
              </div>
            )}
          </div>
        </div>
      </div>

      {/* Side Navigation */}
      <div
        className={`fixed top-16 left-0 h-[calc(100vh-4rem)] bg-white shadow-sm z-40 transition-all duration-300 `}

      >
        <div className="flex flex-col py-4">
          {sideNavItems.map((item, index) => (
            <a
              key={index}
              href={item.path}
              className="flex items-center px-4 py-4 hover:bg-gray-100 transition-colors group relative"
            >
              {/* Icon - Always Visible */}
              <div className="flex items-center justify-center">
                <item.icon
                  size={32}
                  className="text-gray-600 group-hover:text-green-600"
                />
              </div>

              {/* Label - Only visible when expanded */}
              <span
                className={`ml-4 whitespace-nowrap transition-all duration-300 ${
                  isExpanded ? "opacity-100 translate-x-0" : "opacity-0 -translate-x-4"
                }`}
              >
                {item.label}
              </span>

              {/* Tooltip - Only visible when collapsed and hovered */}
              {!isExpanded && (
                <div className="absolute left-16 bg-gray-800 text-white px-3 py-1 rounded text-sm opacity-0 group-hover:opacity-100 transition-opacity whitespace-nowrap">
                  {item.label}
                </div>
              )}
            </a>
          ))}
        </div>
      </div>

      {/* Main Content Container */}

    </div>
  );
};

export default Navigation;
